Pairc Boubandjida

Nature Documentary hosted by Angela NicAoidh, published by BBC broadcasted as part of BBC Soillse series in 2012 - English narration


Information
------------------------------

Boubandjida a national park created in the 60's in northern Cameroon, is a paradise of 220,000 acres for many species: antelopes, primates, wildcats and elephants... but it's an endangered paradise. Neglected for years, the park is being reborn thanks to the work of Paul Bour and his team. With the collaboration of the Park's manager and the inhabitants, the park's supervision is reinforced more and more each day. The awareness of the nearby village inhabitants is increasing and the concept of 'nature protection' is starting to be understood.

